import * as React from "react";
import css from "./DatePart.module.scss";

type Props = {
  location: string;
  part: {};
  index: number;
};

export const DatePart: React.FC<{
  location: string;
  part: { [key: string]: any };
  gridIndex: number | null;
}> = ({ location, part, index }) => {
  return <div className={part.css}></div>;
};
